import React, { Component } from "react";
//import IndexInfo from "./indexInfo";

const API =
  "https://npdpl9r340.execute-api.us-east-1.amazonaws.com/prod/marketdata/v1/index/HDAI/last";

class indexDetails extends Component {
  constructor(props) {
    super(props);

    this.state = {
      constituents: [],
      isLoading: false
    };
  }

  componentDidMount() {
    this.setState({ isLoading: true });

    fetch(API)
      .then(response => response.json())
      .then(data =>
        this.setState({ constituents: data.constituents, isLoading: false })
      );
  }

  //  state = {};
  render() {
    const { constituents, isLoading } = this.state;

    if (isLoading) {
      return <p>Loading... </p>;
    } else {
      return (
        <ul>
          {constituents.map(constituents => (
            <li key={constituents.assetId}>
              Name: {constituents.assetId} | YtD:{constituents.returns.YtD}
            </li>
          ))}
        </ul>
      );
    }
  }
}

export default indexDetails;
